import logo from './logo.svg';
import './App.css';

const schoolinfo = require('CollegeBasketballTeams.json'); //with path


function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.tsx</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}




class Schools extends React.Component 
<{name: string; school: string; city: string; state: string}>
{
  render() {
    const oneSchool = this.props;
    return (
      <div>
        <h2>Name: {oneSchool.school}</h2>
        <h3>Mascot: {oneSchool.name}</h3>
        <h3>Location: {oneSchool.city}, {oneSchool.state}</h3>
      </div>
    )
  }
}

export default Ap;
